import React from 'react';
import PropTypes from 'prop-types';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import { Skeleton } from '@material-ui/lab';
import Typography from '@material-ui/core/Typography';

const data = [
  {
    src:
      'https://langwitch.ru/wp-content/uploads/2020/04/healthy_lifestyle_blog.jpg',
    title: '8 tips for healthy eating',
    topic: 'Food',


    link: '/8-tips-for-health-eating'
  },
  {
    src: 
    'https://cdn3.vectorstock.com/i/1000x1000/94/62/healthy-habits-lifestyle-concept-vector-20729462.jpg',
    title: '7 Healthy Habits for a Healthy Life',
    subtitle: 'Habits',


    link: '/7-healthy-habits-healthy-life'
  },
  {
    src:
    'https://i.pinimg.com/originals/5d/6b/c3/5d6bc3ca3d5655769662474362ad3a7d.jpg',
    title: 'Creating Healthy Habits',
    subtitle: 'Habits',
    link: '/creating-healthy-habits'
  },
//   {
//     src:
//       'https://i.ytimg.com/vi/kkLk2XWMBf8/hqdefault.jpg?sqp=-oaymwEYCNIBEHZIVfKriqkDCwgBFQAAiEIYAXAB&rs=AOn4CLB4GZTFu1Ju2EPPPXnhMZtFVvYBaw',
//     title: 'Calvin Harris, Sam Smith - Promises (Official Video)',
//     channel: 'Calvin Harris',
//     views: '130 M views',
//     createdAt: '10 months ago',
//     link: '/mood'
//   },

];

function Media(props) {
  const { loading = false } = props;

  return (
    <Grid container wrap="nowrap">
      {(loading ? Array.from(new Array(3)) : data).map((item, index) => (
        <Box key={index} width={210} marginRight={0.5} my={5}>
          {item ? (
            <img style={{ width: 210, height: 118 }} alt={item.title} src={item.src} />
          ) : (
            <Skeleton variant="rect" width={210} height={118} />
          )
          }

          {item ? (
            <Box pr={2}>
              <Typography gutterBottom variant="body2">
                <a href={item.link}>{item.title}</a>
              </Typography>
              <Typography display="block" variant="caption" color="textSecondary">
                {item.subtitle}
              </Typography>

            </Box>
          ) : (
            <Box pt={0.5}>
              <Skeleton />
              <Skeleton width="60%" />
            </Box>
          )}
        </Box>
      ))}
    </Grid>
  );
}

// Media.propTypes = {
//   loading: PropTypes.bool,
// };

export default function YouTube() {
  return (
    <Box overflow="hidden">
      <Media  />
      {/* <Media /> */}
    </Box>
  );
}
